import React, {Component} from 'react'

class Bookshelf extends Component {
  constructor(props) {
    super(props)
  }

  render() {
    return(
      <table className="table">
        <tbody>
          <tr>
            <td scope="row" data-label={props.bookCoverTitle !== undefined ? props.bookCoverTitle : 'Book Cover'}><img src={props.cover}/></td>
            <td data-label={props.bookNameTitle !== undefined ? props.bookNameTitle : 'Book Name'}><a {...a} href={props.url} target="_blank" rel="noopener noreferrer">{props.name}</a></td>
          </tr>
        </tbody>
      </table>
    )
  }
}

export default Bookshelf
